import React from "react";

const Navbar = () => {
  return (
    <header class="header">
      <h1 class="logo">
        <a href="#">Flexbox</a>
      </h1>
      <ul class="main-nav">
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Portfolio</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
      </ul>
    </header>
  );
};

export default Navbar;
